import React from 'react';
// import Resume from '../../images/resume.pdf';

function Resume() {
  return (
    <div>
      <h1>Download my resume</h1>
      <h3>Proficiencies</h3>
      <ol>
        <li>MySQLExpressWeb APIs,
           Third Party APIs, Object Relational Mapping, 
           Model-View Controller, React</li>
        <li>Node.js</li>
        <li>Handlebars</li>
        <li>Git</li>
        <li>Web APIs</li>
        <li>Third Partu APIs</li>
        <li></li>

      </ol>

    </div>
  );
}

export default Resume;
